Identificatorul Licenței, fiind un identificator unic la nivel global pentru o licență sau contract sub care articolele sunt generate, trimise pentru procesare și/sau plătite, care este construit prin concatenarea:
 - un cod de agenție de emitere ISO/IEC 15459;
 - un număr de licență sau contract care se conformează specificațiilor agenției emitente respective;
 și care:
 - cuprinde doar caractere alfanumerice majuscule și/sau numerice;
 - este unic (adică, este distinct de orice alt identificator conform ISO/IEC 15459) în domeniul agenției emitente;
 - nu poate fi derivat de la orice alt identificator conform ISO/IEC 15459, emis sub aceeași agenție emitentă, prin simpla adăugare de caractere la, sau eliminarea lor de la, capătul său.

Codul zonei de pescuit FAO definit de Departamentul de Pescuit și Acvacultură al FAO (http://www.fao.org. Căutați sub-site-ul Codului Zonei de Pescuit).
Toate caracterele subgrupului GS1 General Specification-definit de ISO/IEC 646 sunt permise.
Exemple:
18L37.1.3 Marea Mediterană de Vest, Sardinia;
18L47.B.1 Atlantic, Sud-Est, Divizia SEAFO, ZEE Namibia;
18L67 Pacific, Nord-Est.

Codul Locației '26L', fiind un cod care identifică o locație sau zonă geografică, sau un grup asociat de astfel de locații sau zone, care are relevanță pentru o tranzacție asociată și care se conformează cu una dintre structurile definite în (a) până la (f) de mai jos:
a) două caractere alfanumerice majuscule corespunzătoare codului țării ISO 3166-1 cu două alfa ale țării în care, sau constând din aceasta, sunt situate locația(ele) sau zona(ele);
b) trei caractere alfanumerice majuscule corespunzătoare codului IATA al aeroportului sau orașului în, aproape de, sau constând din aceasta, sunt situate locația(ele) sau zona(ele);
c) patru sau mai multe caractere dintre care primele trei corespund unui cod de țară ISO 3166-1 urmat de o cratimă (-), cu restul fiind un cod poștal în țara respectivă;
d) patru sau mai multe caractere dintre care primele trei corespund unui cod de țară ISO 3166-1 urmat de un punct (.), cu restul fiind un cod de subdiviziune a țării ISO 3166-2 în țara respectivă;
e) cinci caractere alfanumerice majuscule corespunzătoare codului UN/LOCODE al zonei în, aproape de, sau constând din aceasta, sunt situate locația(ele) sau zona(ele);
f) concatenarea, fiind nu mai puțin de șapte sau mai mult de 35 de caractere în lungime, de:
- un cod de agenție de emitere ISO/IEC 15459;
- un cod de locație, constând din caractere trase din setul {A-Z; 0-9} care se conformează cu specificațiile agenției emitente respective.

Locația Evenimentului UN/LOCODE.
UN/LOCODE urmat de un caracter plus (+) urmat de una sau mai multe valori de cod din Lista de Coduri EDIFACT 3227 'Calificator de cod funcție de locație', de ex.,
7 Locul Livrării Finale;
5 Portul de Plecare;
9 Portul de Încărcare;
11 Portul de Descărcare;
13 Locul de Transbordare;
24 Portul de Intrare;
35 Țara de Export;
88 Locul de Primire de la Transportator;
125 Port Străin înainte de Plecare spre SUA;
147 Celula/Poziția de Stivuire;
159 Locul de livrare (către destinatar);
248 Locația de Încărcare
http://www.unece.org/cefact/locode/.

Identificator pentru Echipamente Marine Specifice aprobate sub Directiva Uniunii Europene privind Echipamentele Marine (2014/90/EU) și Regulamentul de Implementare (UE) 2018/608.
Format:
• DI (an3);
• Tipul modulului(i) de evaluare a conformității (CA) stabilit(ă) în Anexa II la Directiva 2014/90/EU utilizat(ă) pentru evaluarea conformității (a1);
• Numărul de identificare al organismului notificat (NB) atribuit de Comisie în conformitate cu punctul 3.1 din Anexa IV la Directiva 2014/90/EU (n4);
• Certificatul (an5...20)

Sistemul de Informații pentru Științele și Pescuiturile Acvatice (ASFIS) 'Codul de specii inter-agenții cu 3 alfa', menținut de Organizația pentru Alimentație și Agricultură a Națiunilor Unite (www.fao.org, apoi căutați 'ASFIS').
Exemple;
7RMUC = crap noroios;
