Codul Internațional Standard de Clasificare a Uneltelor de Pescuit (ISSCFG) al Organizației pentru Alimentație și Agricultură (FAO) (www.fao.org)
Toate caracterele subsetului GS1 General Specification-definit de ISO/IEC 646 sunt permise.
Exemple:
8R02.1.0 = Plase de plajă;
8R03.1.5 = Plase de creveți;
8R05.1.0 = Plase de ridicare portabile.

Metoda de producție pentru pește și fructe de mare specificată de Departamentul de Pescuit și Acvacultură al Organizației pentru Alimentație și Agricultură (FAO) a Națiunilor Unite, conform Regulamentului UE 1379/2013. (www.fao.org).
