9R03 = Crescut.

Identificatorul Echipamentului, fiind un identificator unic la nivel global pentru un dispozitiv, un articol de echipament sau o instanță a unei aplicații informatice utilizate în producția, transportul, procesarea sau alte manipulări ale articolelor, care este construit prin concatenarea:
 - un cod de agenție de emitere ISO/IEC 15459;
 - un număr de echipament care se conformează cu specificațiile agenției emitente respective; și care:
 - cuprinde doar caractere alfanumerice majuscule și/sau numerice;
 - este unic (adică, este distinct de orice alt identificator conform ISO/IEC 15459) în domeniul agenției emitente;
 - nu poate fi derivat de la orice alt identificator conform ISO/IEC 15459, emis sub aceeași agenție emitentă, prin simpla adăugare de caractere la, sau eliminarea lor de la, capătul său.
ID-ul Cititorului.
Identificatorul echipamentului, fiind un identificator unic la nivel global pentru un dispozitiv, un articol de echipament sau o instanță a unei aplicații informatice utilizate în producția, transportul, procesarea sau alte manipulări ale articolelor.

Codul Locației UPU, fiind un cod care identifică o locație sau o zonă geografică, sau un grup asociat de astfel de locații sau zone, care are relevanță pentru o tranzacție asociată și care se conformează uneia dintre structurile definite în a) până la g) de mai jos:
a) două caractere alfabete majuscule corespunzând codului țării ISO 3166-1 alfa 2 al țării în care, sau din care, locația(ele) sau zona(ele) sunt situate;
b) trei caractere alfabete majuscule corespunzând codului IATA al aeroportului sau orașului în, aproape de, sau din care, locația(ele) sau zona(ele) sunt situate;
c) patru sau mai multe caractere dintre care primele trei corespund unui cod de țară ISO 3166-1 urmat de o cratimă (-), restul fiind un cod poștal în țara respectivă;
d) patru sau mai multe caractere dintre care primele trei corespund unui cod de țară ISO 3166-1 urmat de un punct (.), restul fiind un cod de subdiviziune a țării ISO 3166-2 în țara respectivă;
e) cinci caractere alfabete majuscule corespunzând codului UN/LOCODE al zonei în, aproape de, sau din care, locația(ele) sau zona(ele) sunt situate;
f) șase caractere alfanumerice majuscule corespunzând codului IMPC UPU alocat în conformitate cu standardul UPU S34;
g) concatenarea, având o lungime de nu mai puțin de șapte și nu mai mult de 25 de caractere, a:
 - unui cod de emitent alocat în conformitate cu standardele UPU S31;
 - unui cod de locație, constând din caractere extrase din setul {A-Z; 0-9} care se conformează specificațiilor emitentului respectiv.

Placa de Înmatriculare cu Datele Serviciului și Codul Locației este o construcție de date compusă, conformă cu specificația din standardul UPU S25, care include specificația:
 - unui identificator de articol conform ISO/IEC 15459;
 - unei specificații conforme cu identificatorul de date 5U al serviciului care trebuie furnizat în raport cu articolul;
 - unui cod de locație UPU conform cu identificatorul de date 17U sau unui cod de locație UPU calificat conform cu identificatorul de date 18U.
 Notă - Pentru detalii suplimentare, vă rugăm să consultați standardul UPU S25. Distincția între un cod simplu de locație UPU (DI 17U) și un cod de locație UPU calificat (DI 18U) poate fi determinată din primul caracter. Dacă acesta este numeric, se aplică 18U; dacă este alfabetic, se aplică 17U.

Eveniment, Dată și Oră.
Formatul ISO YYYYMMDDHHMM (ceas de 24 de ore - UTC) urmat imediat de un Calificator de Cod UN/EDIFACT 2005 care oferă un cod specificând tipul datei), de exemplu,
11 [Data când se estimează că mărfurile vor fi expediate/trimise când mesajul este emis.];
17 [Data/ora estimată a livrării când se estimează că mărfurile vor fi livrate];
35 [Data la care mărfurile sunt livrate la destinația lor.];
118 [Confirmarea Rezervării];
129 [Data când vasul/mărfurile au părăsit ultimul port străin în țara exportatoare.];
132 [Data/ora când transportatorul estimează că un mijloc de transport ar trebui să ajungă la portul de descărcare sau locul de destinație.];
133 [Data/ora când transportatorul estimează că un mijloc de transport ar trebui să plece de la locul de plecare];
137 [Data/ora când furnizorul expediază piesele pe baza cererii clientului. (Data când mesajul DESADV este emis. Recomandarea este ca DESADV să fie emis în termen de 30 de minute de la ridicarea mărfurilor la partea de expediere];
146 [Data Estimată de Intrare (Vamală) data la care data oficială a unei Intrări Vamale este anticipată.];
151 [Data Importului (Sosit la port cu intenția de a descărca];
186 Pleacă de la o Facilitate ('Ieșire din poartă)'];
204 [Data la care Vama eliberează mărfurile transportatorului sau importatorului];
253 [Pleacă de la un Port ('Plecare Vas')];
252 [Sosire la un Port ('Sosire Vas')];
283 [Sosire la o Facilitate ('Intrare în poartă)'];
342 [Încărcarea Transportului];
351 [Inspecția Porții Terminale];
411 [Comandat Umplut];
412 [Comandat Golit];
420 [Descărcarea Transportului];
534 [Reparat];
677 [Confirmat Umplut];
678 [Confirmat Golit];
696 [Data Depunerii].

Data, reprezentată în formă modificată conform UTC:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] unde parantezele pătrate indică opționalitatea și yyyy este anul, mmdd luna și ziua, hhmmss ora zilei în ore minute și secunde, fff fracțiunile de secunde și poooo offsetul de la UTC exprimat în ore și minute, offsetul fiind pozitiv dacă p este un punct (.), negativ dacă P este un semn minus (-).
EXEMPLU:
2005 - (UTC) anul calendaristic 2005;
200505 - (UTC) luna calendaristică Mai 2005;
20050518 - (UTC) 18 Mai 2005;
200505181247 - 12:47 UTC pe 18 Mai 2005;
200505181247.0100 - 12:47 ora locală, fiind 11:47 UTC, pe 18 Mai 2005;
20050518124723099 - 99 de milisecunde după 12:47:23 UTC pe 18 Mai 2005.

Data Calificată, constând în concatenarea:
- unui cod de agenție de emitere ISO/IEC 15459;
- unui calificator de dată conform cu specificațiile acelei agenții de emitere;
- unei date ale cărei format și interpretare se conformează cu specificațiile agenției emitente pentru acel calificator de dată.

Declarația Categoriei Materialelor de Ambalaj*, Cod* și Greutate pentru un anumit material de ambalaj utilizat într-un anumit ambalaj conform directivei UE privind ambalajele și deșeurile de ambalaje. (Categoria materialului și codul definit în Anexa M).
12ECCMMMMMMNNNNNUU unde: - '12E' (an3) este Identificatorul de Date;
 - 'CC' (n2) este Categoria Materialului conform Anexei M;
 - 'MMMMMM' (an1...6) este Codul Materialului conform Anexei M;
 - 'NNNNN' (n5) Greutatea Materialului, inclusiv punctul zecimal (de exemplu, 12.12);
 - 'UU' (an2) este Unitatea de măsură pentru greutate (de exemplu, KG, GR, LB sau OZ conform ANSI X12.3 ca în Anexa D).

Numele Părții.
Numele unei părți urmat de un caracter plus (+) urmat de una sau mai multe valori de coduri din Lista de Coduri EDIFACT 3035 'Calificativul Părții', de ex.;
BY [Cumpărător];
CF [Operatorul containerului];
CN [Destinatar];
CS [Consolidator];
DEI [Operatorul navei/capitanul navei];
FA [Codul personalului operațional];
IM [Importator];
MF [Producător];
OS [Expeditor];
SE [Vânzător];
ST [Trimite la];
UC [Destinatarul final].

Numărul Destinatarului.
Numărul unic de identificare poate fi IRS, EIN, SSN sau numărul atribuit de CBP, după cum este necesar pe Declarația de Securitate. Numai următoarele formate trebuie utilizate: IRS EIN: NN-NNNNNNN;
IRS EIN cu sufix:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
Numărul atribuit de CBP: YYDDPP-NNNNN.
